import './App.css';
import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
    align-items: center;
    flex-direction: row;
    justify-items: center;
`

function App() {
  return (
    <div className="App">
      <div>Header</div>
      <Wrapper>
        <div>Aircrafts</div>
        <div>Rotation</div>
        <div>Flights</div>
      </Wrapper>
    </div>
  );
}

export default App;
